import React from 'react'

const about = () => {
    return (
        <div className="container">
            <h3>
The​ ​Office​ ​of​ ​the​ ​Internal​ ​Vice President​ is the liaison of the student body and staffs at UCLA. As an office, we assist 1000+ student groups. Our main goal is to create centralized platforms. We guide student signatories to book meeting rooms and event venues and help student leaders to apply for different fundings. We are currently working with dedicated undergraduate students to build a website and a mobile application. Also, we work on various projects throughout the year!</h3>
            <h1>What is IVP?</h1>
            <h1>Mission Statement</h1>
        </div>
    )
}

export default about
